import './App.css';
import Navbar from './components/navbar';
import Home from './components/home';
import Movies from './components/movies';
import Footer from './components/footer';
import Celebs from './components/celebs';

function App() {

  return (
    <div className="App">
      <Navbar/>
      <Home/>
      <Movies/>
      <Celebs/>.
      <Footer/>

    </div>
  );
}
export default App;
